script: |
  super -f text -I q5256.spq | sort > q5256.out

inputs:
  - name: q5256.spq
    data: |
      SELECT DISTINCT + cor1.col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5256.out
    data: |
      1
      33
      82
